  content: "Hi Matt! Thanks for joining us tonight, and sorry you had a less than\
    \ stelar experience! A lot of these lists can be tough, but that's how we will\
    \ win---combing through these difficult lists and finding the diamonds in the\
    \ rough who we can persuade. But, even if you're getting wrong numbers, this is\
    \ still a big help! You are helping to clean up our call lists so that we won't\
    \ have to waste any more time trying to connect with those people when it matters\
    \ the most during the final stretch of GOTV! No one should be rude to you, but\
    \ if they are, always please feel free to politely end the call immediately, mark\
    \ \"hostile\" (which also removes them from our list!), and move on! Thanks again\
    \ for being here---you're making a big difference, even though sometimes it can\
